import { Component } from '@angular/core';

@Component({
    selector: 'ngx-tiny-mce-page',
    template: `
    <nb-card>
      <nb-card-header>
        Tiny MCE
      </nb-card-header>
      <nb-card-body>
        <ngx-tiny-mce></ngx-tiny-mce>
      </nb-card-body>
    </nb-card>
  `
})
export class TinyMCEComponent {}
